import React from 'react';
import { RadarChart } from 'recharts'
import { PolarAngleAxis } from 'recharts';
import { PolarGrid } from 'recharts';
import { PolarRadiusAxis } from 'recharts';
import { Radar } from 'recharts';
import { Legend } from 'recharts';

const data = [
    {
      "subject": "Language C",
      "A": 120,
      "B": 110,
      "fullMark": 150
    },
    {
      "subject": "Language Java",
      "A": 98,
      "B": 150,
      "fullMark": 150
    },
    {
      "subject": "HTML",
      "A": 86,
      "B": 130,
      "fullMark": 150
    },
    {
      "subject": "JavaScript",
      "A": 99,
      "B": 100,
      "fullMark": 150
    },
    {
      "subject": "React",
      "A": 85,
      "B": 90,
      "fullMark": 150
    },
    {
      "subject": "Base de donnée SQL",
      "A": 65,
      "B": 85,
      "fullMark": 150
    }
  ]


const WidgetOne = () => {
    return (
      
    <RadarChart outerRadius={90} width={730} height={250} data={data}>
        <PolarGrid />
        <PolarAngleAxis dataKey="subject" />
        <PolarRadiusAxis angle={30} domain={[0, 150]} />
        <Radar name="Lucas" dataKey="A" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6} />
        <Radar name="Thibault" dataKey="B" stroke="#82ca9d" fill="#82ca9d" fillOpacity={0.6} />
        <Legend />
    </RadarChart>
    );
};

export default WidgetOne;
